css:
[data-zen="true"] atom-workspace,
[data-zen="true"] atom-pane-container atom-pane,
[data-zen="true"] atom-pane-container atom-pane .item-views {
  background: #002b36 !important;
}
[data-zen="true"] atom-text-editor:not(.mini) {
  margin: 0 auto;
  max-width: 100%;
}
[data-zen="true"] .tab-bar {
  display: none;
}
[data-zen="true"] .wrap-guide {
  visibility: hidden;
}
[data-zen="true"] .status-bar {
  height: 0;
}
[data-zen="true"] ::shadow .gutter {
  display: none;
}
[data-zen="true"][data-zen-word-count="visible"] .status-bar .word-count {
  position: fixed;
  bottom: 10px;
  right: 10px;
  padding: 0 10px;
  background: #002b36;
  color: #839496;
}
[data-zen="true"][data-zen-tabs="visible"] .tab-bar {
  display: flex;
  justify-content: center;
}
[data-zen="true"][data-zen-tabs="visible"] .tab-bar .tab {
  display: none;
}
[data-zen="true"][data-zen-tabs="visible"] .tab-bar .active {
  display: block;
  width: 100%;
}
